import React, { Component } from 'react'
import { Card } from 'react-bootstrap';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faUsers, faStar, faShareAlt, faExclamation, } from "@fortawesome/free-solid-svg-icons";
import "./index.css";
export default class MyCard extends Component {
  openNewPage = () => {
    window.open(this.props.htmlUrl);
  };
  render() {
    const {
      listNum,
      avatar,
      name,
      starsCount,
      forksCount,
      openIssuesCount,
    } = this.props;
    return (
      <div className="MyCard" onClick={this.openNewPage} title={name}>
        <Card className="Card" style={{ marginBottom: 20, backgroundColor: 'skyblue' }}>
          <div className="CardNum" style={{ textAlign: 'center' }}>#{listNum}</div>
          <Card.Img className="CardImg img-fluid img-thumbnail" style={{ width: '100%' }} variant="top" src={avatar} />
          <Card.Body>
            <Card.Title className="CardTitle" style={{ textAlign: 'center' }}>{name}</Card.Title>
            <Card.Text>
              <FontAwesomeIcon style={{ color: '#ffbf74', width: 20 }} icon={faUsers} />{name}
              <FontAwesomeIcon style={{ color: '#ffd700', width: 20 }} icon={faStar} />{starsCount} stars
              <FontAwesomeIcon style={{ color: '#82c3f5', width: 20 }} icon={faShareAlt} />{forksCount} fork
              <FontAwesomeIcon style={{ color: '#f18a92', width: 20 }} icon={faExclamation} />{openIssuesCount} open issues

            </Card.Text>
          </Card.Body>
        </Card>
      </div>
    );
  }
}
MyCard.defaultProps = {
  listNum: '???',
  avatar: 'https://avatars.githubusercontent.com/u/63722633?v=4',
  name: '???',
  starsCount: '???',
  forksCount: '???',
  openIssuesCount: '???'
}
